declare const SQL_QUERY = "\nINSERT INTO Phone (\n  \"number\", \"createdAt\", \"updatedAt\", \"deletedAt\", \"system\", \"sms\", \"voice\", \"ndnc\"\n) VALUES (\n  @number, @createdAt, @updatedAt, @deletedAt, @system, @sms, @voice, @ndnc\n)\nON CONFLICT (\"number\") DO UPDATE SET\n\"createdAt\" = MIN(@createdAt, \"createdAt\"), \"updatedAt\" = MAX(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"system\" = IFNULL(@system, \"system\"), \"sms\" = IFNULL(@sms, \"sms\"), \"voice\" = IFNULL(@voice, \"voice\"), \"ndnc\" = IFNULL(@ndnc, \"ndnc\")\n";
export default SQL_QUERY;
